import fetch from 'isomorphic-unfetch'

export default {
  name: 'Netflix',
  search: async (query) => {
    console.log('owo')
    const res = await fetch(`https://unogs.com/nf.cgi?u=5unogs&q=${encodeURIComponent(query)}-!1900,2019-!0,5-!0,10-!0,10-!Any-!Any-!Any-!Any-!I%20Don&t=ns&cl=21,23,26,29,33,307,45,39,327,331,334,265,337,336,269,267,357,65,67,392,268,400,402,408,412,447,348,270,73,34,425,432,46,78&st=adv&ob=Relevance&p=1&l=100&inc=&ao=and`, {
      headers: {
        'Cookie': `PHPSESSID=52mbin4up2mmi8cdu5pd03h587; cooksess=52mbin4up2mmi8cdu5pd03h587; sstring=${encodeURIComponent(query)}-!1900%2C2019-!0%2C5-!0%2C10-!0%2C10-!Any-!Any-!Any-!Any-!I%20Don-!and`,
        'Host': 'unogs.com',
        'Referer': 'https://unogs.com/',
        'X-Requested-With': 'XMLHttpRequest'
      }
    })
    const json = await res.json()
    console.log('UWUUW', json)

    return query.map(([
      _, name, image, description, __, ___, type, year, ...rest
    ]) => {
      console.log('REST', rest)
      return {
        name,
        image,
        description,
        type,
        year
      }
    })
  }
}
